import React, { Component } from 'react';
import {Title} from 'react-native-paper';
import {View} from 'react-native';


class ListeDem extends React.Component {
  render(){
    return(
        <View>
          <Title> Liste des demandes </Title>
        </View>
    );
  };
};

export default ListeDem
